import React from "react";
import Snare from "../components/Snare";

const SnareNoiseControlsContainer = props => {
  return (
    <div className="card">
      <div className="column">
        <div className="title">
          <small className="title">Noise</small>
        </div>
        <Snare
          knobs="osc"
          kickPitchDecay={props.kickPitchDecay}
          kickPitchDecayHandler={props.kickPitchDecayHandler}
          kickOscTypeHandler={props.kickOscTypeHandler}
          kickNote={props.kickNote}
          kickNoteHandler={props.kickNoteHandler}
        />
      </div>
    </div>
  );
};

export default SnareNoiseControlsContainer;
